Static variables and register variables are two types of variables in C programming language.

1. Static Variables:
A static variable is a variable that has been allocated statically, i.e., at compile time. It retains its value between function calls and is initialized only once. Static variables are declared using the keyword "static".

There are two types of static variables:

a. Static Local Variables:
These variables are declared inside a function, but their scope is limited to that function. They are initialized only once and retain their value between function calls.

Example:
```c
#include <stdio.h>

void func() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    func();
    func();
    func();
    return 0;
}
```
Output:
```
Count: 1
Count: 2
Count: 3
```

b. Static Global Variables:
These variables are declared outside of any function, but their scope is limited to the file in which they are declared. They are initialized only once and retain their value between function calls.

Example:
```c
#include <stdio.h>

static int count = 0;

void func() {
    count++;
    printf("Count: %d\n", count);
}

int main() {
    func();
